import React from 'react';

class About extends React.Component {
  render() {
    return (
      <div>
        <h1>About</h1>
        <p>Developer: David Gabrielyan, backend developer</p>
        <p>Contact info: gabrielyandavo144707@gmail.com</p>
        <p>Date published: 8 Mar 2021</p>
      </div>
    );
  }
}

export default About;
